import React from 'react';
import {useLocation} from 'react-router-dom'

export default function CostumerDetails(props) {

    const costumersArray = props.costumersArray;
    const loaction = useLocation();
    const {costumer} = loaction.state;
    console.log(loaction.state);

    return (
      <div>
        <ul>
          <li>{costumersArray.name}</li>
          <li>{costumersArray.id}</li>
          <li>{costumersArray.address}</li>
          <li>{costumersArray.phoneNumber}</li>
          <li>{costumersArray.plateNumber}</li>
        </ul>
      </div>
    );
}
